    e.ModifiedBy,
    e.ModifiedDate
  FROM Employee e
    LEFT JOIN Department d
      ON e.DepartmentId = d.DepartmentId
  WHERE Filter IS NULL
  OR e.EmployeeCode LIKE CONCAT('%', Filter, '%')
  OR e.EmployeeName LIKE CONCAT('%', Filter, '%')
  OR e.PhoneNumber LIKE CONCAT('%', Filter, '%')
  OR e.TelephoneNumber LIKE CONCAT('%', Filter, '%')
  ORDER BY e.CreatedDate, e.EmployeeCode
